import React from "react";
import { useLocation } from "react-router-dom";

function Dashboard() {
  const location = useLocation();
  const username = location.state?.username || "User";

  return (
    <div style={{ padding: "2rem" }}>
      <h1>Hello {username}</h1>
    </div>
  );
}

export default Dashboard;
